import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, ImageBackground, Vo} from 'react-native';
import AppButton from '../components/MyButton';
import NewButton from '../components/button.js';

export default function Home({ navigation }) {
    const localImage = require('./assets/multi-colour.jpg');
    return (
        <ImageBackground source={localImage }style={styles.container}>
        <Text style={styles.title}>Movie Hub</Text>
        <br></br>
        <Text style={styles.header}> Sign up to find streaming links to your movie of choice</Text> 
        <AppButton />   
        <NewButton buttonText="Enter"></NewButton> 
        </ImageBackground>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: 'dodgerblue',
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        color: 'yellow',
        fontWeight: 'bold',
        textDecorationLine: 'underline',
        fontSize: 50,
    },
    header: {
        color: "black",
        fontWeight: "bold",
        fontSize: 20,
    },
    subheader: {
        color: "black",
        fontSize: 16,
    },
    text: {
        color: "black",
        fontSize: 14,
    }

});
